import './App.css';
import Header from './screens/templates/header'
//import LastPropertyForSales from './screens/components/lastPropertyForSales'

import React, { useEffect, useState } from 'react';

function App() {

  const [propertyId, setPropertyId] = useState(null)
  const [properties, setProperties] = useState(null)

  useEffect(() => {
    async function fetchData() {
      const res = fetch("http://localhost:8000/api/v1/properties")
      res
        .json()
        .then(res => setProperties(res))
        .catch(err => console.log(err))
    }

    fetchData()
  })

  console.log(results)

  return (
    <div className="App">
        <Header />
        <h1>Properties list</h1>
        <p>{`${properties}`}</p>
        {!propertyId || !propertyStatus ? 'loading...': `${propertyId} ${propertyStatus}`}
    </div>
  );

}

export default App;
